jQuery(function() {
	initSlickCarousel();
	initCarousel();
	initTabs();
	initOpenClose();
	initCustomForms();
	initMobileNav();
	initAnchors();
	initMasonry();
	initView();
	intiRemovePost();
	initBackgroundResize();
});

// Remove Post
function intiRemovePost() {
	var post = jQuery(".recent-post , .project");
	post.each(function() {
		var $this 	 = jQuery(this),
			btnClose = $this.find(".btn-close");
		$this.on("click", '.btn-close', function(e) {
			e.preventDefault();
			$this.remove();
		});
	});
}

// List/Grid view 
function initView() {
	var viewBlock = jQuery(".view"),
		content = jQuery(".filter-content");
	viewBlock.each(function() {
		var $this 	   = jQuery(this),
			gridView   = $this.find(".grid-view"),
			listView   = $this.find(".list-view"),
			holderList = $this.find("li");
			listActive = "list-active",
			gridActive = "grid-active";

		holderList.on("click", (gridView,listView),function(e) {
			e.preventDefault();
			var $self = jQuery(this);
			$self.addClass("active").siblings().removeClass("active");
		});

		gridView.on("click", function() {
			(content.hasClass(listActive)) ? content.removeClass(listActive).addClass(gridActive) : content.addClass(gridActive);
			initMasonry();
		});
		listView.on("click", function() {
			(content.hasClass(gridActive)) ? content.removeClass(gridActive).addClass(listActive) : content.addClass(listActive);
			initMasonry();
		});
	});
}

// stretch background to fill blocks
function initBackgroundResize() {
	jQuery('.bg-stretch').each(function() {
		ImageStretcher.add({
			container: this,
			image: 'img'
		});
	});
}

// slick init
function initSlickCarousel() {
	jQuery('.slick-slider').slick({
		slidesToScroll: 4,
		rows: 0,
		slidesToShow: 4,
		arrows: false,
		dots: true,
		dotsClass: 'slick-dots',
		responsive: [{
			breakpoint: 767,
			settings: {
				slidesToScroll: 1,
				slidesToShow: 1,
				dotsClass: 'slick-dots'
			}
		}]
	});

	jQuery('.member-slider').slick({
		slidesToScroll: 1,
		rows: 0,
		prevArrow: '<button class="slick-prev"><i class="icon-ico-arrowleft"></i></button>',
		nextArrow: '<button class="slick-next"><i class="icon-ico-arrowright"></i></button>'
	});
}

// scroll gallery init
function initCarousel() {
	jQuery('.carousel').scrollGallery({
		mask: '.mask',
		slider: '.slideset',
		slides: '.slide',
		stretchSlideToMask: true
	});

	jQuery('.overview-slider').scrollGallery({
		mask: '.mask',
		slider: '.slideset',
		slides: '.slide',
		stretchSlideToMask: true,
		maskAutoSize: true
	});
}

// content tabs init
function initTabs() {
	jQuery('.tabset').tabset({
		tabLinks: 'a',
		addToParent: true
	});

	jQuery('.tabset-block').tabset({
		tabLinks: 'a',
		addToParent: true
	});
}

// open-close init
function initOpenClose() {
	jQuery('.open-close').openClose({
		activeClass: 'active',
		opener: '.opener',
		slider: '.slide',
		animSpeed: 400,
		effect: 'slide'
	});

	jQuery('.more-list').openClose({
		activeClass: 'active',
		opener: '.more',
		slider: '.list-slide',
		animSpeed: 400,
		effect: 'slide'
	});

	jQuery('.project-slider').openClose({
		activeClass: 'active',
		opener: '.opener',
		slider: '.slide',
		animSpeed: 400,
		effect: 'slide'
	});
}

// initialize custom form elements
function initCustomForms() {
	jcf.replaceAll();
}

// mobile menu init
function initMobileNav() {
	jQuery('.search-block').mobileNav({
		menuActiveClass: 'active',
		menuOpener: '.search-opener',
		hideOnClickOutside: true,
		menuDrop: 'div'
	});
	jQuery('.drop-block').mobileNav({
		menuActiveClass: 'active',
		menuOpener: '.btn-opener',
		hideOnClickOutside: true,
		menuDrop: 'ul'
	});
	jQuery('body').mobileNav({
		menuActiveClass: 'happen-acitve',
		menuOpener: '.btn-happen'
	});
	jQuery('body').mobileNav({
		menuActiveClass: 'celestial-active',
		menuOpener: '.btn-celestial'
	});
	jQuery('body').mobileNav({
		menuActiveClass: 'filter-active',
		menuOpener: '.btn-filter'
	});
	jQuery('body').mobileNav({
		menuActiveClass: 'ojbect-active',
		menuOpener: '.btn-ojbect'
	});
	jQuery('body').mobileNav({
		menuActiveClass: 'info-active',
		menuOpener: '.btn-info'
	});
}

// initialize smooth anchor links
function initAnchors() {
	new SmoothScroll({
		anchorLinks: '.btn-top',
		extraOffset: 0,
		wheelBehavior: 'none'
	});
}

// masonry init
function initMasonry() {
	jQuery('.masonry').masonry({
		itemSelector: '.post',
		columnWidth: 1,
		resize: true,
		gutter: 0,
		isOriginLeft: true
	});
}


